import React, { Component } from "react";

import Discover from "../Discover";
import Loading from "./Loading";
import MovieCarousel from "../MovieCarousel";
import { connect } from "react-redux";

import {
  getNowPlaying,
  getUpcoming,
  getStudioGhibli,
  getTopRated
} from "../../actions/movieActions";

import { getAsianDramas, getPopularTV } from "../../actions/tvActions";

export class Home extends Component {
  componentDidMount() {
    this.props;
  }
  render() {
    return (
      <div>
        <Discover />

        <MovieCarousel />
        <MovieCarousel />
        <MovieCarousel />
        <MovieCarousel />
        <MovieCarousel />
        <MovieCarousel />

        <Loading />
      </div>
    );
  }
}

const mapStateToProps = state => ({
  nowPlaying: state.home.getNowPlaying,
  upcoming: state.home.getUpcoming,
  studioGhibli: state.home.getStudioGhibli,
  topRated: state.home.getTopRated,
  asianDramas: state.home.getAsianDramas,
  popularTv: state.home.getPopularTV
});

export default connect(
  mapStateToProps,
  {
    getAsianDramas,
    getPopularTV,
    getNowPlaying,
    getUpcoming,
    getStudioGhibli,
    getTopRated
  }
)(Home);
